window.bookSummaryJSON = "<p>The life of a lifesaver.</p> <p>DocWagon - saviors of the needy, rescuers of the desperate. Willing to go anywhere, rescue anyone, as long as that “anyone” has forked out enough advance cash to justify the effort.</p> <p>Reporter Amelia Hart has embedded herself with a DocWagon team to see what their life is really like, and she’s in for a wild ride. From an OD’ing celebrity to an aggressive team of hackers, from pesky gangs to an extremely rich and powerful client teetering at death’s door, this night will give the team all they can handle. But will they survive long enough to remember that in the Sixth World, nothing is truly random?</p> <p>Full of memorable characters and rich Sixth World flavor, <i>DocWagon 19</i> is a thrilling ride with the people struggling to save lives in a sprawl with a million ways to make people dead. Strap in, hold on, crank up the siren, and get ready for a crazy ride-along through the full chaos of the Shadowrun setting.</p>"; 
